import { Helmet } from 'react-helmet';
import { Typography } from "@material-ui/core"

const Dashboard = () => (
    <>
    <Helmet>
    <title>DashBoard</title>
  </Helmet>

  <Typography>
      This Is DashBoard
  </Typography>
  </>
);

export default Dashboard;
